<script type="text/javascript">
        $('.social_button').on('click', function() {
          var type = $(this).data('type'),
            title = $('title').html(),
            url = location.href,
            width = 450,
            height = 400,
            go = false;

          switch( type ) {
            case 'vkontakte': 
              go = 'https://vk.com/share.php?url=:URL&title=:TITLE&display=widget'; 
              break;

            case 'facebook': 
              go = 'https://www.facebook.com/sharer.php?src=sp&u=:URL&t=:TITLE'; 
              break;

            case 'twitter': 
              go = 'https://twitter.com/intent/tweet?status=:TITLE%20:URL'; 
              break;

            case 'odnoklassniki': 
              go = 'https://connect.ok.ru/dk?cmd=WidgetSharePreview&st.cmd=WidgetSharePreview&st.shareUrl=:URL'; 
              break;

            case 'moimir': 
              go = 'http://connect.mail.ru/share?share_url=:URL'; 
              break;
          }

          if ( go ) {
            go = go.replace(':TITLE', encodeURIComponent(title)).replace(':URL', encodeURIComponent(url));

            window.open(go, "social", 'width=' + width + ',height=' + height + ',left=' + ((window.innerWidth - width)/2) + ',top=' + ((window.innerHeight - height)/2));
          }

          return false;
        });
        
        $(document).delegate( ".downloadItems", "click", function(e) {
            let markDownload = '<span style="padding-left: 3px; font-size: 18px; color: rgb(0, 173, 239);">•</span>';
